import React, { Component } from "react";
import KeresService from "../service/KeresService";
import { Link } from "react-router-dom";
import FajtaService from "../service/FajtaService";

class KeresekComponent extends Component {
  constructor(props) {
    super(props);

    this.state = {
      keresek: [],
      fajtak: [],
    };
  }

  componentDidMount() {
    FajtaService.getFajtak()
      .then((res) => {
        this.setState({ fajtak: res.data });
      })
      .catch(function (ex) {
        console.log("Response parsing failed. Error: ", ex);
      });

    KeresService.getKeresek()
      .then((res) => {
        this.setState({ keresek: res.data });
      })
      .catch(function (ex) {
        console.log("Response parsing failed. Error: ", ex);
      });
  }

  render() {
    return (
      <div>
        <table className="keresekTable">
          <thead>
            <tr>
              <th>Anyajobbful</th>
              <th>Anyabalful</th>
              <th>Apajobbful</th>
              <th>Apabalful</th>
              <th>bakok</th>
              <th>nostenyek</th>
              <th>fajta</th>
              <th>szuldat</th>
              <th>tenyeszto</th>
            </tr>
          </thead>
          <tbody>
            {this.state.keresek.map((keres) => (
              <tr key={keres.id}>
                <td>{keres.anyajobbful}</td>
                <td>{keres.anyabalful}</td>
                <td>{keres.apajobbful}</td>
                <td>{keres.apabalful}</td>
                <td>{keres.bakok}</td>
                <td>{keres.nostenyek}</td>
                <td>{keres.fajta}</td>
                <td>{keres.szuldat}</td>
                <td>{keres.nev}</td>
                <td>
                  {this.state.fajtak.map((fajta) => (
                    <button id="" className="infoBtn">
                      <Link to={`/confirmare/${fajta.rovidites}`}>
                        Jovahagyas
                      </Link>
                    </button>
                  ))}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    );
  }
}

export default KeresekComponent;
